import React from "react";
import {Route, Switch} from "react-router-dom";

const Home = () =>{
    return(
        <>
        <div>
            <Switch>
                <Route exact path="/" component={Error} />
                <Route exact path="/1" component={Comment}/>
                <Route exact path="/2" component={Note}/>
                <Route exact path="/3" component={Error}/>
            </Switch>
        </div>
    </>
    );
}
export default Home;
